export const requestUsersInfo = () => ({
  type: "REQUEST_USER_INFO",
});

export const receiveUserProfile = (profile) => ({
  type: "RECEIVE_USER_PROFILE",
  profile,
});

export const receiveUserProfileError = () => ({
  type: "RECEIVE_user_PROFILE_ERROR",
});
